            if dp[i][j] != 0:
                c = (int(phone_number[i + 1]) + j) // 2
                d = (int(phone_number[i + 1]) + j + 1) // 2
                if c != d:
                    dp[i + 1][c] += dp[i][j]
                    dp[i + 1][d] += dp[i][j]
                else:
                    dp[i + 1][c] += dp[i][j]
    s = 1
    for i in range(10):
        s += dp[-1][i]
    t = 0
    c = int(phone_number[0])
    f = [phone_number[0]]
    for i in range(1, len(phone_number)):
        d = (c + int(phone_number[i])) // 2
        e = (c + int(phone_number[i]) + 1) // 2
        if int(phone_number[i]) == d:
            f.append(phone_number[i])
            c = d
        elif int(phone_number[i]) == e:
            f.append(phone_number[i])
            c = e
        else:
            break
    if ''.join(f) == phone_number:
        t = 1
    return s - t

